var fs = require('fs');
var cs = require('casper').create({
    pageSettings : {
        loadImages : false,
        loadPlugins : false,
    },
    viewportSize : {
        width : 800,
        height : 600
    },
    clientScripts : [ 'jquery-1.9.1.js' ]
});
var header = "<html><head><meta http-equiv='Content-Type' content='text/html; charset=utf-8'/><meta name='viewport' content='width=device-width, minimum-scale=1.0, maximum-scale=2.0' /></head><body>";
var footer = "</body><html>";
cs.on('remote.message', function(msg) {
    this.echo('remote: ' + msg);
});

cs.start();
var rootDir = '/home/yang/Desktop/mmgirl/';
var infoPath = rootDir + 'info';

var currentIndex = getCurrentIndex(infoPath);

crawlPage('http://www.mm-girl.com/' + list[currentIndex][0] + '-dangan-' + list[currentIndex][1] + '.html', rootDir, currentIndex++, infoPath);

cs.run();

function getCurrentIndex(infoPath) {
    if (fs.isFile(infoPath) == false) {
        return 0;
    }
    var file = fs.open(infoPath, 'r');
    var r = null;
    while (true) {
        var s = file.readLine();
        if (s && s.length > 0) {
            r = s;
        } else {
            break;
        }
    }
    file.close();
    if (r) {
        return parseInt(r.substr(0, r.indexOf('@@@'))) + 1;
    } else {
        return 0;
    }
}
function crawlPage(url, rootDir, index, infoPath) {
    console.log(index + '   ' + url);
    cs.thenOpen(url);
    cs.then(function() {
        var c = this.evaluate(processPage);
        /*console.log(c.html);
        console.log(c.name);*/
        console.log(c.desc);
        if (c.imgs && c.imgs.length > 0) {
            for ( var i = 0; i < c.imgs.length; i++) {
                //console.log(c.imgs[i]);
                c.html = c.html.replace(c.imgs[i], 'data:image/png;base64,' + cs.base64encode(c.imgs[i]));
            }
        }
        var dir = rootDir + index;
        if (fs.isDirectory(dir) == false) {
            fs.makeDirectory(dir);
        }
        fs.write(dir + '/i.html', header + c.html + footer, 'w');
        fs.write(infoPath, index + '@@@' + c.name + '@@@' + c.desc + '\n', 'a');
        if (currentIndex < list.length) {
            crawlPage('http://www.mm-girl.com/' + list[currentIndex][0] + '-dangan-' + list[currentIndex][1] + '.html', rootDir, currentIndex++, infoPath);
        } else {
            console.log('done');
        }
    });
}

function processPage() {
    try {
        $('.bshare').remove();
        $('b:contains("分享到")').remove();
        $('#pics').remove();
        $('.mypic h3:last:contains("写真")').remove()
        $('.right').remove();
        $('script').remove();
        $('a').removeAttr('href');
        var imgs = $('img', $('.mypic'));
        var imgList = [];
        for ( var i in imgs) {
            if (imgs[i] && imgs[i].tagName) {
                imgList[imgList.length] = imgs[i].src;
            }
        }
        // get name
        var name = $('.jj b');
        if (name && name.length > 0) {
            name = name[0].innerText;
        } else {
            name = '未知明星';
        }
        // get description
        var max = 50, min = 25;
        var getTextNodesIn = function(el) {
            return $(el).find(":not(script)").addBack().contents().filter(function() {
                return this.nodeType == 3;
            });
        };
        var largest = '';
        var n = getTextNodesIn($('.mypic')[0]);
        for ( var i = 0; i < n.length; i++) {
            var node = n[i];
            if (node && node.nodeValue) {
                node = $.trim(node.nodeValue);
            } else {
                node = '';
            }
            if (node.length > largest.length) {
                largest = node;
            }
            if (largest.length > min) {
                break;
            }
        }

        if (largest.length = 0) {
            largest = '暂无介绍';
        }

        if (largest.length > max) {
            largest = largest.substr(0, max);
        }

        return {
            html : $.trim($('.mypic').html()),
            imgs : imgList,
            desc : $.trim(largest),
            name : name
        };
    } catch (e) {
        console.log(JSON.stringify(e));
        return {
            html : '暂无介绍',
            imgs : null,
            desc : '暂无介绍',
            name : '未知明星'
        };
    }
}